export function CompaniesData() {
	return [
	{
		"name": "Omnidata",
		"address": {
			"country": "Maroc",
			"city": "20340 Casablanca",
			"address": "74, bd Abdelmoumen, 2°ét."
		},
		"contact": {
			"phone": "+212 5 22 77 56 48",
			"fax": "",
			"website": ""
		},
		"juridicInfos": {
			"nature": " Siège",
			"creationYear": "1990",
			"juridicForm": "Société anonyme",
			"activity": "Programmation informatique (6201)",
			"capital": "",
			"effectif": ""
		},
		"products": [],
		"dirigeants": [],
		"Partenaires": [
			{
				"nom_partenaire": "oracle",
				"type": "Build, Sell, or Service Oracle License & Hardware Products"
			},
			{
				"nom_partenaire": "ibm",
				"type": "Reseller"
			}
		]
	}
	]
}

export function renderCompanyName(state, val) {
	return (
		state.name.toString().toLowerCase().indexOf(val.toLowerCase()) !== -1
	);
}
